import React from "react";
import { Dropdown } from 'semantic-ui-react'

const servers = [
  {
    key: 'LAN',
    text: 'LAN',
    value: 'LAN'
  },
  {
    key: 'LAS',
    text: 'LAS',
    value: 'LAS'
  },{
    key: 'NA',
    text: 'NA',
    value: 'NA'
  },
]

const dropdownForm  = () => (
  <Dropdown
    placeholder="Select Region"
    fluid
    selection
    options={servers}
  />
)

export default dropdownForm
